import tempimage from "./leeskatepic.jpg"

const ProjectTile = ({title}) => {
  print("test")
	return (
		<div className="projecttile">

      <img src={tempimage} id='image'/>

      <div id='projecttitle'>
        {title}
      </div>
      <div>

      </div>
		</div>
	)
}

export default ProjectTile;
